import React, { useEffect } from 'react'
import Aos from "aos";
import "aos/dist/aos.css"

function Skills_card(props) {

    useEffect(() => {
        Aos.init({ duration: 2000 });
    }, [])

    return (
        <div className='skill-box' data-aos="fade-up">
            <p> {props.name} </p>
        </div>
    )
}

export default Skills_card
